SELECT COALESCE(country, 'All Countries') as countries, COALESCE(province, 'All Provinces') as Provinces,COALESCE(city, 'All Cities') as cities,  ROUND(SUM(population), 2) as percentage
FROM (SELECT c2.name as country, c1.name as city, c1.province as province, c1.population FROM city c1, country c2 where c1.country = c2.code) AS city_og
GROUP BY ROLLUP (country, province, city) ORDER BY country, province, city asc;

